def find_most_suitable_dimensions(m, a, b):

    def prime(n):
        prime_flag = [0 for _ in range(n + 1)]
        prime_list = []
        for i in range(2, n + 1):
            if prime_flag[i] == 0:
                prime_list.append(i)
                temp = 1
                while temp * i <= n:
                    prime_flag[temp * i] = 1
                    temp += 1
        return prime_list
    prime_list = prime(100000)
    rate = a * b
    ans = [0, 0]
    for i in prime_list:
        if i > m:
            break
        for j in prime_list:
            if i * j <= m:
                if i / j >= rate and i / j <= 1:
                    if ans[0] * ans[1] < i * j:
                        ans = [i, j]
            else:
                break
    return tuple(ans)

